import { createStore } from 'vuex'

const state = {};
const getters = {};
const mutations = {
  redirectTo(state, payload) {
    this.router.push({ name: payload });
  }
};
const actions = {
  redirectTo({ commit }, payload) {
    commit("redirectTo", payload.val);
  },
};

export default createStore({
  state,
  getters,
  mutations,
  actions,
  modules: {
  }
})
